-- Deploy emapic:add_madrid_layers to pg

BEGIN;

	CREATE TABLE "base_layers"."madrid_distritos" (gid serial,
	"nombre" varchar(50),
	"coddistrit" varchar(2) unique,
	"poblacion" numeric(10,0));
	ALTER TABLE "base_layers"."madrid_distritos" ADD PRIMARY KEY (gid);
	SELECT AddGeometryColumn('base_layers','madrid_distritos','geom','4326','MULTIPOLYGON',2);

	CREATE TABLE "base_layers"."madrid_barrios" (gid serial,
	"codbar" varchar(4) unique,
	"coddistrit" varchar(2) references base_layers.madrid_distritos(coddistrit),
	"codbarrio" varchar(12) unique,
	"nombre" varchar(50),
	"poblacion" numeric(10,0));
	ALTER TABLE "base_layers"."madrid_barrios" ADD PRIMARY KEY (gid);
	SELECT AddGeometryColumn('base_layers','madrid_barrios','geom','4326','MULTIPOLYGON',2);
	
	GRANT SELECT, REFERENCES ON base_layers.madrid_barrios TO :emapic_db_user;
	GRANT SELECT, REFERENCES ON base_layers.madrid_distritos TO :emapic_db_user;

	CREATE OR REPLACE FUNCTION assign_madrid_barrio()
	  RETURNS trigger AS
	$BODY$
	DECLARE
		new_madrid_barrio int;
		new_madrid_barrio_dist real;
	BEGIN
		IF (TG_OP = 'INSERT') THEN
		    SELECT gid INTO new_madrid_barrio FROM base_layers.madrid_barrios ORDER BY st_distance(geom, new.geom) ASC LIMIT 1;
		    SELECT st_distance_sphere(geom, new.geom) INTO new_madrid_barrio_dist FROM base_layers.madrid_barrios WHERE gid = new_madrid_barrio;
		    IF (new_madrid_barrio_dist <= 22200) THEN
		        new.madrid_barrio_gid = new_madrid_barrio;
		    ELSE
		        new.madrid_barrio_gid = null;
		    END IF;
		    RETURN new;
		END IF;
		IF (TG_OP = 'UPDATE') THEN
		    IF (old.geom IS NULL) OR NOT (old.geom = new.geom) THEN
		        SELECT gid INTO new_madrid_barrio FROM base_layers.madrid_barrios ORDER BY st_distance(geom, new.geom) ASC LIMIT 1;
		        SELECT st_distance_sphere(geom, new.geom) INTO new_madrid_barrio_dist FROM base_layers.madrid_barrios WHERE gid = new_madrid_barrio;
		        IF (new_madrid_barrio_dist <= 22200) THEN
		            new.madrid_barrio_gid = new_madrid_barrio;
		        ELSE
		            new.madrid_barrio_gid = null;
		        END IF;
		        RETURN new;
		    END IF;
		    RETURN new;
		END IF;
		RETURN old;
	END;
	$BODY$
	  LANGUAGE plpgsql VOLATILE;

COMMIT;
